import React from 'react'

import {NavLink} from 'react-router-dom'

import './Experience.scss'

export default function Experience() {
    return (
        <div className="ContextContainer">

        <div className="uk-flex uk-flex-center MenuBar ">
            <NavLink to="/home" activeClassName="ItemSelected"><p className="MenuItem">Home</p></NavLink>
            <NavLink to="/about" activeClassName="ItemSelected"><p className="MenuItem">About</p></NavLink>
            <NavLink to="/experience" activeClassName="ItemSelected"><p className="MenuItem">Experience</p></NavLink>
            <NavLink to="/contact" activeClassName="ItemSelected"><p className="MenuItem">Contact</p></NavLink>
        </div>









    </div>
    );
}
